import Router from "./router";
import './test/test';

interface PageInfo {
  title: string;
}

type Page = 'home' | 'about' | 'concat';

function App() {
  const x: Record<Page, PageInfo> = {
    home: { title: '111' },
    about: { title: '222' },
    concat: { title: '333' },
  }
  return (
    <div className="App">
      <Router></Router>
    </div>
  );
}

export default App;
